How do I connect mongoose/mongodb to my React App.js file<p>Most of the tutorials I am seeing use a express.js file to route all get and post requests. I am using a React component using react-router-dom, do I need to use express? If yes, what is the best way to do so? Here is what my app is looking like following along 1/4 of this tutorial so far: <a href="https://www.youtube.com/watch?v=WDrU305J1yw&amp;t=1693s" rel="nofollow noreferrer">https://www.youtube.com/watch?v=WDrU305J1yw&amp;t=1693s</a></p>

<p>The mongoose code is probably misplaced and breaks the app.</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>import React, { Component } from 'react';
import { Route } from 'react-router-dom';
import mongoose from 'mongoose';

import '../styles/App.css';

import Input from './Input';

mongoose.connect(
  'mongodb://admin-01:PW@node-log-shard-00-00-ecvwz.mongodb.net:27017,node-shot-log-shard-00-01-ecvwz.mongodb.net:27017,node-shot-log-shard-00-02-ecvwz.mongodb.net:27017/test?ssl=true&amp;replicaSet=node-shot-log-shard-0&amp;authSource=admin&amp;retryWrites=true',
  {
    useMongoClient: true
  }
);

class App extends Component {
  render() {
    return (
      &lt;div&gt;
        &lt;div&gt;
          &lt;Route exact path='/' component={ Input } /&gt;
        &lt;/div&gt;
      &lt;/div&gt;
    );
  }
}

export default App;</code></pre>
</div>
</div>
</p>

