<p>My update function is as follows</p>

<pre><code>Audit.findByIdAndUpdate(id, 
                       {$set:req, $push: { status: {status_value: req.status_value }} },  
                       { new: true, runValidators: true })
                       .lean().exec( function (err, audit) {
    if (err) {
      console.log(err)
      callback(err, null)
    }
    else if (!audit) {
      console.log("update_fucntion user not found")
      callback(null, null)
    }
    else {
      console.log('finished update\n\n')
      console.log(audit)
