Node.js querying MongoDB to return all matches that begin with any value from array<p>I'm trying to query MongoDB via a Node.js application to return all matches that begin with any of the entries in the following array: ['p','q','r','s','t']</p>

<p>I know how to do a "begins with" for single values:</p>

<pre><code>var value = 't';
genericCollection.find({ 'key' : new RegExp('^' + value, 'i')}).toArray(function (err, items) {
    res.send(items);
});
</code></pre>

<p>Returns:</p>

<pre><code>[
    {
        "_id": "59788e1a1b4a3901c7fd5501",
        "key": "t-key",
        "value": "t-value",
        "lastModified": "2018-11-27T12:18:30.029Z"
    }
]
</code></pre>

<p>And I know how to do a "matches any of these values" query:</p>

<pre><code>var values = ['p-key', 't-key'];
genericCollection.find({ 'key' : { $in : values}}).toArray(function (err, items) {
    res.send(items);
});
</code></pre>

<p>Returns:</p>

<pre><code>[
    {
        "_id": "59788e1a1b4a3901c7fd5501",
        "key": "t-key",
        "value": "t-value",
        "lastModified": "2018-11-27T12:18:30.029Z"
    },
    {
        "_id": "5978ba139553e32697564d7e",
        "key": "p-key",
        "value": "p-value",
        "lastModified": "2018-11-27T12:18:55.966Z"
    }
]
</code></pre>

<p>But how can I combine the two so that I get all results from the DB that begin with <em>any</em> of those array values?</p>

