Mongoose / MongoDB aggregate filter by multiple date ranges<p>I have a collection with 365 documents. Each document is as follows:</p>

<pre><code>{
  date: "2018-11-27T00:00:00.000Z",
  title: "Went to school"
},
{
  date: "2018-11-28T00:00:00.000Z",
  title: "Bought a car"
}
</code></pre>

<p>I want to filter documents by multiple data ranges.
Example: </p>

<ol>
<li>Show only documents that have been created after <code>2018-01-04</code> and before <code>2018-11-24</code></li>
<li>Result should not contain documents that were created in interval <code>2018-05-06</code> - <code>2018-06-07</code> etc</li>
</ol>

<p>So far I got this:</p>

<pre><code>const dates = await Calendar.aggregate(
  [{
      $match: {
        $and: [{
            date: {
              $not: {
                $lte: new Date(2018, 0, 7),
              }

            }
          },
          {
            date: {
              $not: {
                $gte: new Date(2018, 10, 15)
              }
            }
          },
          {
            date: {
              $not: {
                $gt: new Date(2018, 6, 31),
                $lt: new Date(2018, 7, 15)
              }
            }
          }
        ]
      }
    },
    {
      $project: {
        title: 1,
        date: 1
      }
    }
  ]
).sort('date')
</code></pre>

<p>Thank you in advance!</p>

